import { Jumbotron, Container } from 'reactstrap';




const FooterBanner = () => (
 <div>
 <div class="css-11zk6ke">
 

<section className="css-1r974q8">
    <header className="css-1wu2h8j">
          <h1>Fast, Free Shipping,<br/>Contactless Delivery.<br/></h1>
          <p>Try it now, risk free!</p>
          <a href="#feature">
          <button className="css-j5c32g">
            <span className="css-vurnku">Shop Now</span>
            <svg width="15.394" height="10" viewBox="0 0 15.394 10">
              <path d="M13.674,6.343,12.427,7.6l2.89,2.877-12.025.012,0,1.768,11.992-.012L12.444,15.1,13.7,16.343l4.988-5.012Z" transform="translate(-3.292 -6.343)"></path>
            </svg>
          </button>
        </a>
    </header>
</section>
 </div>
 </div>
);

export default FooterBanner;
